  input: '"TEXT","F3A","C00345090","Please note the following changes have been made
    to this report:  The Column B figures for the summary and detailed summary page
    information should equal the sum of the Column B figures on our pervious report
    and the Column A figures on this report.  The purpose for the disbursement to
    the NRCC has been corrected to reflect PAC-Hammond.  The credit card disbursements
    have been itemized to identify each vendor that has an aggregate in excess of
    $200.00 as a memo entry.  The disbursements to individuals for transactions other
    than travel, meals, and lodging etc. have been corrected by itemizing the vendor
    that has an aggregate in excess of $200.00 as a memo entry.  Schedule A of our
    report indicates that we may have failed to file one or more of the required 48
    hour notices regarding last minute contributions received by our committee after
    the close of books for the 12-Day Pre-Primary Election report.  These 48-Hour
    notices were filed in a timely manner via facsimile.  When calling the FEC to
    confirm the receipt of the transmission, it was brought to our attention that
    although these were acceptable, all subsequent 48-hour notices must be filed electronically.  In
    further conversations with our reports analyst it is our understanding that we
    do not have to re-file these 48 Hour notices to correct our original error.  The
    contributions from Nestor de Armas have been corrected to reflect a re-designation
    of $1,000 to the General Election."'
